exports=async function(bid,options){const{parseInfo}=await require("transcode/parse_info"),url=`http://m.edu-gamll.com/${bid.idPrefix()}_${bid}/`;return parseInfo("\u5C0F\u4E66\u5305",url,"block_txt2",{clientOptions:{...(options&&options.clientOptions)}}).then(_=>(_.intro=_.intro.replace(/《[^》]+》简介:/,"").trim(),_))};